@import './grid.scss';
@import './reset.scss';
@import './variables.scss';

.flex {
  display: flex;
}

.flex1 {
  flex: 1;
}

.flex-align-center {
  @extend .flex;
  align-items: center;
}

.flex-column {
  @extend .flex;
  flex-direction: column;
}

.flex-wrapper {
  @extend .flex;
  flex-wrap: wrap;
}

.flex-center {
  @extend .flex-align-center;
  justify-content: center;
}

.flex-sb-c {
  @extend .flex-align-center;
  justify-content: space-between;
}

.flex-sa-c {
  @extend .flex-align-center;
  justify-content: space-around;
}

.inline-block {
  display: inline-block;
}

.block {
  display: block;
}

html, body {
  margin: 0;
  height: 100%;
  box-sizing: border-box;
  -moz-osx-font-smoothing: grayscale;
  -webkit-font-smoothing: antialiased;
  text-rendering: optimizeLegibility;
  font-family: "Helvetica Neue",Helvetica,"PingFang SC","Hiragino Sans GB","Microsoft YaHei","微软雅黑",Arial,sans-serif;
  -webkit-text-size-adjust: none;
  -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
}

#app {
  height: 100%;
  font-size: 14px;
}

.zheader {
  position: fixed;
  top: 0;
  right: 0;
  left: 0;
  height: 80px;
  background: #fff;
  box-shadow: 0 2px 4px rgba(0, 0, 0, .12), 0 0 6px rgba(0, 0, 0, .04);
  &-inner {
    width: 1186px;
    height: 100%;
    margin: auto;
  }
  &-menu {
    height: 100%;
  }
  &-btn-box {
    margin-left: 142px;
    font-size: 0px;
  }
  &-btn {
    display: inline-block;
    color: $--color-primary;
    font-size: 16px;
    width:88px;
    line-height:30px;
    text-align: center;
    border:1px solid $--color-primary;
    border-radius:4px;
    &.active {
      background: $--color-primary;
      color: #fff;
    }
  }
}

.zfooter {
  background: #313131;
}
